import './App.css';
import React, { Component } from "react";

import {
  Route,
  NavLink,
  HashRouter
} from "react-router-dom";
import homepagje from "./homepage";
import browsedogs from "./browsedogs";
import login from "./login";
import register from "./register";


class App extends Component {
  render() {
    return (
 <HashRouter>
<div>

<div class="homepagestuff">

<div class="buttonrows">
<div class="indexbut">
<button type="button"  class="btn btn-secondary btn-lg"> <NavLink to="/homepage">Homepage</NavLink></button>
</div>

<div class="browsebut">
<button type="button" class="btn btn-secondary btn-lg"><NavLink to="/browsedogs">Browse dogs</NavLink></button>
</div>

<div class="loginbut">
<button type="button" class="btn btn-secondary btn-lg"><a href="/login">Login</a></button>
</div>

<div class="registerbut">
<button type="button" class="btn btn-secondary btn-lg"><a href="/register">Register</a></button>
</div>
</div>



</div>
</div>
 </HashRouter>
 );
  }
}





export default App;
